import { MDBContainer } from "mdbreact";
import React from "react";
import "./WishListPage.scss";
function WishListPage() {
  return (
    <div>
      <MDBContainer>
        <h1>My wishlist on BeShop</h1>
      </MDBContainer>
    </div>
  );
}

export default WishListPage;
